import React from 'react';
import {} from 'React-router-dom';
 Navbar = () => {
  return (
    <nav className='navbar bg-dark'>
        <h1>
            <a to=''>
                <i className='fas fa-store'></i></a>
        </h1>
        <ul>
            <li><a to="">Marchants</a></li>
            <li><a to="">Resgister</a></li>
            <li><a to="">Login</a></li>
        </ul>
    </nav>
  )
}

export default Navbar
